import React, { useState } from "react";
import { Button, Input, Card, CardContent } from "@/components/ui";
import axios from "axios";
import { toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";

toast.configure();

const TokenFetcher = () => {
  const [apiKey, setApiKey] = useState("");

  const fetchToken = async () => {
    if (!apiKey) {
      toast.error("Por favor, insira a API Key");
      return;
    }

    try {
      const response = await axios.get(`https://api.oriondata.io/api/Token?apiKey=${apiKey}`);
      toast.success("Token validado com sucesso");
      console.log("Token:", response.data);
    } catch (error) {
      toast.error("Erro ao validar token");
      console.error("Erro:", error);
    }
  };

  return (
    <div className="flex items-center justify-center h-screen bg-gray-100">
      <Card className="p-6 w-96 bg-white shadow-lg rounded-lg">
        <CardContent>
          <h2 className="text-xl font-semibold mb-4">Validar API Key</h2>
          <Input
            type="text"
            placeholder="Digite sua API Key"
            value={apiKey}
            onChange={(e) => setApiKey(e.target.value)}
            className="mb-4 w-full p-2 border rounded"
          />
          <Button onClick={fetchToken} className="w-full bg-blue-500 text-white p-2 rounded">
            Validar Token
          </Button>
        </CardContent>
      </Card>
    </div>
  );
};

export default TokenFetcher;
